import React from "react";

const InstitutionInfo = () => {
  return (
    <div className="flex flex-col dropDownDesc">
      <p className="flex flex-col gap-4">
        Provides detailed information about colleges, universities,
        and educational institutions offering various courses and programs.
        This section helps students explore institution details such as
        available courses, location, and general academic focus to support
        informed decision-making.
      </p>
    </div>
  );
};

export default InstitutionInfo;
